import React from 'react';
import { Segment } from 'semantic-ui-react'
import HeaderPart from '../HeaderSegement/HeaderPart';
import MainSegment from '../HeaderSegement/HeaderPart';

const Home = () => {

    return (
        <div>
            <Segment.Group>
                <Segment inverted>
                    <HeaderPart/>
                </Segment>

                <Segment inverted>
                    <MainPart/>
                </Segment>

            </Segment.Group>
        </div>
    )
}

export default Home;
